function [diff_vel_v, Twist_normal, Vel_dd_v, Twist_dd_v] = getCartisenVelAcc(path)    % 输入单位 长度为mm 旋转为deg    data=csvread(path);    % 读取第1，2，3列，        origin = data(:,1:3)/1000;    data(:,4:6) = data(:,4:6)/180*pi;        diff_vel_v =[];    Vel_dd_v =[];    % 计算速度差分     diffFrame = diff(origin)/0.004;    ddFrame = diff(diffFrame)/0.004;        % 先构造 frame     for i = 1:length(diffFrame)        norm1 = norm(diffFrame(i,:));        diff_vel_v = [diff_vel_v, norm1];    end            % 先构造 frame     for i = 1:length(ddFrame)        dnorm1 = norm(ddFrame(i,:));        Vel_dd_v = [Vel_dd_v, dnorm1];    end        % 读取第4，5，6列，    x = data(:,4:6);    Tr_v = [];        for i = 1:length(x)        Tr = SE3.convert(poseToMatrix(data(i,:)));        Tr_v = [Tr_v, Tr];    end        Twist_normal = [];    Twist_v =[];    for i = 1:length(x)-1        [theta, w] = trlog(Tr_v(i).R'*Tr_v(i+1).R);        Twist_normal = [Twist_normal, theta/0.004];        Twist_v = [Twist_v, Tr_v(i).R*theta*w/0.004];    end                Twist_dd = diff(Twist_v')/0.004;    Twist_dd_v= [];    for i = 1:length(Twist_dd)-1        Twist_dd_normal = norm(Twist_dd(i,:));        Twist_dd_v = [Twist_dd_v, Twist_dd_normal];    end     end